// ahora crearemos funciones quqe nos permitan marcar una tarea como terminada, editar, eliminar
// para ello tenemos que hacer comunicacin entre componentes, es decir de el componente TodoForm que necesito llenar este formulario que al precionar un boton se va a guardar y esta nueva tarea que se guarda
// quiero mostrarla en TodoList
import React, { useState } from 'react'
import Todo from './Todo'

const initialTodos = [
    {
        id: 1, //agregamos id por en mensaje de error en consola
        title: 'todo #1',
        description: 'Descripcion Todo #1',
        complete: false,
    },
    {
        id: 2, //agregamos id por en mensaje de error en consola
        title: 'todo #2',
        description: 'Descripcion Todo #2',
        complete: true,
    }
]
function TodoList() {
    const [todos, setTodos] = useState(initialTodos)

    return (
        <div>
            <h1>TodoList</h1>
            {
                todos.map(todo => <Todo todo={todo} key={todo.id} />)
            }
        </div>
    )
}

export default TodoList
